	// 	<img src={props.rand[2].front} className='pokeImg3'></img> 
	// 	<img src={props.rand[3].front} className='pokeImg4'></img>

	return(
		<div className='region' id={props.name}>
			{pokeList}
		</div>
	)	
}

export default Region;
